import React, { useState } from "react";
import { Link } from "react-router-dom";
import "../styles/Home.css";

function Home() {
  // Dummy placeholders for API data
  const [stockData, setStockData] = useState({
    symbol: "AAPL",
    price: "—",
    change: "—",
    changePercent: "—",
  });

  const [currencyData, setCurrencyData] = useState({
    base: "EUR",
    rates: { USD: "—", GBP: "—", PKR: "—" },
  });

  return (
    <div className="home-page">
      <h1>Welcome to My Portfolio</h1>
      <p>Check the latest market stock prices and currency exchange rates below:</p>

      <div className="home-buttons">
        <Link to="/login" className="home-btn">Login</Link>
        <Link to="/signup" className="home-btn">Sign Up</Link>
      </div>

      {/* Stock Section */}
      <div className="dashboard-section">
        <h2>Stock Market</h2>
        <div className="card">
          <p><strong>Symbol:</strong> {stockData.symbol}</p>
          <p><strong>Price:</strong> {stockData.price}</p>
          <p><strong>Change:</strong> {stockData.change} ({stockData.changePercent})</p>
        </div>
      </div>

      {/* Currency Section */}
      <div className="dashboard-section">
        <h2>Currency Rates (Base: {currencyData.base})</h2>
        <div className="card">
          {Object.entries(currencyData.rates).map(([currency, rate]) => (
            <p key={currency}><strong>{currency}:</strong> {rate}</p>
          ))}
        </div>
      </div>
    </div>
  );
}

export default Home;
